import React from 'react';
import { Link } from 'react-router-dom';

const ArtistNavbar = () => (
  <nav>
    <ul>
      <li><Link to="/artist">Dashboard</Link></li>
      <li><Link to="/my-artworks">My Artworks</Link></li>
      <li><Link to="/upload-artwork">Upload Artwork</Link></li>
      <li><Link to="/profile">Profile</Link></li>
    </ul>
  </nav>
);

export default ArtistNavbar;
